function [C_cmd,flag] = target_gen(gnc_mode, ...
        sc2sun_eci_unit, sc2targ_eci_unit, sc2nadir_eci_unit, ss_offset_rad)
%TARGET_GEN FSW Target Generation Library
%
% Possible GNC modes for SOC-i:
%   CLPM        = 0
%   LPM         = 1
%   Idle        = 2
%   ASM         = 3
%   Desat       = 4
%   SunSeek     = 5
%   Nominal     = 6
%   Imaging     = 7
%   SOAR        = 8
%
% Cole Morgan | T. P. Reynolds
%#codegen

% Body frame vector definitions
COM     = [  0.0;  0.0;  1.0  ]; % COM antenna boresight vector (F_body)
IMG     = [  0.0;  0.0; -1.0  ]; % image camera boresight vector (F_body)
SP      = [  0.0;  1.0;  0.0  ]; % sun sensor boresight vector (F_body)

% Rotate the SP vector into the target frame using ss_offset_rad
flag    = uint8(0);
tol     = 1e-3;         % parallel vector tolerance
soff    = sin(ss_offset_rad);
coff    = cos(ss_offset_rad);
C_B2T   = [ coff, soff, 0.0; -soff, coff, 0.0; 0.0, 0.0, 1.0 ]; 

% Target frame definitions (if different from body frame)
SP_T = C_B2T * SP;

% Uncomment for testing only %   
% SP      = [1;3;0];
% -------------------------- %

% Validity Checks
if (norm(sc2sun_eci_unit) < tol) 
    C_cmd   = eye(3);
    flag    = uint8(1);
    return;
elseif (norm(sc2targ_eci_unit) < tol)
    C_cmd   = eye(3);
    flag    = uint8(2);
    return;
elseif (norm(sc2nadir_eci_unit) < tol)
    C_cmd   = eye(3);
    flag    = uint8(3);
    return;
end

% Main Code
if ( gnc_mode == 7 || gnc_mode == 8 )
    % primary   : align the camera boresight with the target direction
    % secondary : align offset sun sensor boresight with inertial sun
    %             direction
    if ( abs(dot(sc2sun_eci_unit,sc2targ_eci_unit)) > 1-tol )
        C_cmd   = eye(3);
        flag    = uint8(4);
        return;
    end
    C_cmd = align_vecs(SP_T, sc2sun_eci_unit, IMG, sc2targ_eci_unit);

elseif ( (gnc_mode == 4 || gnc_mode == 5 || gnc_mode == 6) )
    % primary   : align offset sun sensor boresight with inertial sun
    %             direction
    % secondary : align the antenna boresight with the nadir direction
    if ( abs(dot(sc2nadir_eci_unit,sc2sun_eci_unit)) > 1-tol )           
        C_cmd   = eye(3);
        flag    = uint8(5);
        return;
    end
    C_cmd = align_vecs(SP_T, sc2sun_eci_unit, COM, sc2nadir_eci_unit);

else
    % No attitude commanded from here for CLPM, LPM, Idle, ASM & SOAR modes
    C_cmd   = eye(3);

end

end

function [C_cmd] = align_vecs(Body1, Inertial1, Body2, Inertial2) 

    % Body
    Body1 = Body1./norm(Body1); %takes precident
    Body2 = Body2./norm(Body2);
    Xtb = Body1;
    Ytb = cross(Body1,Body2);
    Ytb = Ytb./norm(Ytb);%/norm(cross(Body1,Body2));
    Ztb = cross(Body1,Ytb);
    Ztb = Ztb./norm(Ztb);%/norm(cross(Body1,Ytb));

    % Inertial
    Inertial1 = Inertial1./norm(Inertial1); % set to align with B1
    Inertial2 = Inertial2./norm(Inertial2); % set to partially align with B2
    Xti = Inertial1;
    Yti = cross(Inertial1,Inertial2);
    Yti = Yti./norm(Yti);%/norm(cross(Inertial1,Inertial2));
    Zti = cross(Inertial1,Yti);
    Zti = Zti./norm(Zti);%/norm(cross(Inertial1,Yti));

    % Stack vectors
    Cb  = [Xtb, Ytb, Ztb];
    Ci  = [Xti, Yti, Zti];

    % Commanded DCM ( body to inertial )
    C_cmd   = Cb*Ci';

end
